// Get the "decoded" field from the previous node
const decodedString = $json['decoded'];  // Assuming 'decoded' is the field containing the JSON string

// Check if the decoded string exists and is a valid string
if (!decodedString || typeof decodedString !== 'string') {
  return [];  // If invalid, return an empty array
}

// Parse the decoded string into an object
let decodedJson;
try {
  decodedJson = JSON.parse(decodedString);  // Parse the JSON string into an object
} catch (e) {
  return [];  // Return an empty array if JSON parsing fails
}

// Return the parsed object as the output
return [
  {
    json: decodedJson  // Return the entire parsed object from the "decoded" field
  }
];

// Get the 'sections' array from the decoded JSON output
const sections = $json['sections'];  // This assumes the 'sections' array is part of the previous node's output;
const source = $input.first().json.source;

// Check if sections exist
if (!sections || !Array.isArray(sections)) {
  return [];  // If there are no sections or the structure is invalid, return an empty array
}

// Format the sections into individual items for iteration
const items = sections.map(section => ({
  json: {
    section: section.section,    // The content of the section
    sectionId: section.sectionId, // The sectionId
    source: source
  }
}));

// Return the formatted items for iteration
return items;

const lawsCollectionName = $('Edit Fields').first().json.lawsCollectionName;
const casesCollectionName = $('Edit Fields').first().json.casesCollectionName;
let collectionName = $('Process Metadata').first().json.extractedMetadataInfo.source[0] === 'laws' ? lawsCollectionName : casesCollectionName;

// UUIDv4 generator (RFC4122 compliant, pure JS)
function uuidv4() {
  return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function(c) {
    var r = Math.random() * 16 | 0, v = c === 'x' ? r : (r & 0x3 | 0x8);
    return v.toString(16);
  });
}

// Get the current timestamp formatted as YYYY-MM-DD_HHMMSSmmm
const now = new Date();
const timestamp = now.toISOString().replace(/T/, '_').replace(/:/g, '').split('.')[0];

// Generate a Unique Document ID (you could keep this or use the UUID directly for `id`)
const documentId = $('Process Metadata').first().json.extractedSectionInfo.documentId;
const uniqueDocumentId = `${documentId}_${timestamp}`;

// Generate a new UUID for Weaviate "id"
const weaviateId = uuidv4(); // Generates a valid UUID

// Get the embedding and process metadata
const embedding = $items("Embeddings")[0].json.data[0].embedding;
const processMetadata = $items("Process Metadata")[0].json;

// Flatten metadata nicely for Weaviate
const combinedMetadata = {
  content: processMetadata.extractedSectionInfo?.section || '',
  source: processMetadata.extractedMetadataInfo?.source || [],
  entities: processMetadata.extractedMetadataInfo?.entities || [],
  people: processMetadata.extractedMetadataInfo?.people || [],
  dates: processMetadata.extractedMetadataInfo?.dates || [],
  locations: processMetadata.extractedMetadataInfo?.locations || [],
  technical_terms: processMetadata.extractedMetadataInfo?.technical_terms || [],
  metrics: processMetadata.extractedMetadataInfo?.metrics || [],
  uniqueDocumentId: uniqueDocumentId
};

// Construct the payload to upsert to Weaviate, using the UUID for "id"
return [
  {
    json: {
      objects: [
        {
          class: collectionName, // Ensure this matches your Weaviate class name
          id: weaviateId, // Use the generated UUID as the Weaviate "id"
          properties: combinedMetadata,
          vector: embedding // The embedding vector you want to store
        }
      ]
    }
  }
];

try {
  // 1. Compile and Clean Metadata
  const rawMetadataInfo = $input.first().json.output || "";

  // Remove markdown code block if present (supports ```json or ``` with content)
  let cleanedMetadataInfoRaw = rawMetadataInfo
    .replace(/```json\n?/g, '')   // Remove opening ```json
    .replace(/```\n?/g, '')       // Remove closing ```
    .trim();
  // Fallback: if the string doesn't start with '{', extract the first JSON block
  if (!cleanedMetadataInfoRaw.trim().startsWith('{')) {
    const jsonMatch = cleanedMetadataInfoRaw.match(/(\{[\s\S]*\})/);
    if (jsonMatch && jsonMatch[1]) {
      cleanedMetadataInfoRaw = jsonMatch[1];
    }
  }

  let parsedMetadataInfo = {};
  try {
    parsedMetadataInfo = JSON.parse(cleanedMetadataInfoRaw);
  } catch (e) {
    console.log("Error parsing metadataInfo:", e, cleanedMetadataInfoRaw);
    throw new Error("Failed to parse AI-generated metadata");
  }
  // 2. Ensure all expected fields exist and are of correct type
  // List all your expected fields here
  const expectedFields = {
    source: [],
    entities: [],
    people: [],
    dates: [],
    locations: [],
    technical_terms: [],
    metrics: [],
    primary_identifier: "",
    doc_type: "",
    fek_issue: "",
    fek_number: "",
    publication_date: "",
    status: "Ενεργό",
    title: "",
    issuing_authority_detail: "",
    subjects_gr: [],
    part: "",
    chapter: "",
    article: "",
    paragraph: "",
    amendment_operation: "",
    amendment_operations: [],
    amended_article: "",
    new_article_reference: "",
    amends_laws: [],
    references_laws2: [],
    repeals_laws2: [],
    effective_dates2: [],
    transitional_provision: false,
    eu_directive: ""
  };
  // Merge and type-correct
  for (const [key, defaultValue] of Object.entries(expectedFields)) {
    if (!(key in parsedMetadataInfo)) {
      parsedMetadataInfo[key] = defaultValue;
    } else if (Array.isArray(defaultValue)) {
      parsedMetadataInfo[key] = Array.isArray(parsedMetadataInfo[key]) ? parsedMetadataInfo[key] : [];
    } else if (typeof defaultValue === "boolean") {
      parsedMetadataInfo[key] = typeof parsedMetadataInfo[key] === "boolean" ? parsedMetadataInfo[key] : false;
    } else if (typeof defaultValue === "number") {
      parsedMetadataInfo[key] = parsedMetadataInfo[key] !== null && !isNaN(Number(parsedMetadataInfo[key])) ? Number(parsedMetadataInfo[key]) : null;
    } else if (typeof defaultValue === "string") {
      parsedMetadataInfo[key] = typeof parsedMetadataInfo[key] === "string" ? parsedMetadataInfo[key] : "";
    }
  }

  // 3. Section & Document Info
  let section = $('Loop Over Items').first().json.section || "";
  let sectionId = $('Loop Over Items').first().json.sectionId || "";
  let documentId = $('Parse Decoded').first().json.extractedMetadata?.documentId || "";
  // Sanitize the section text
  if (typeof section === 'string') {
    section = section.replace(/\n/g, ' ')
      .replace(/\r/g, ' ')
      .replace(/['"\\\`]/g, '')
      .replace(/[\u00AD\u200B-\u200D\uFEFF]/g, '')
      .replace(/\s+/g, ' ')
      .trim();
  }

  // 4. Validation (as before)
  let validationStatus = 'success';
  let validationMessage = '';
  if (!section || !sectionId) {
    validationStatus = 'error';
    validationMessage = 'Missing required fields in <section_info>: section or section_id.';
  }

  // 5. Final formatted result
  const finalResult = {
    validationStatus,
    validationMessage,
    extractedSectionInfo: {
      section: section,
      section_id: sectionId,
      documentId: documentId
    },
    extractedMetadataInfo: parsedMetadataInfo
  };
  return [{ json: finalResult }];
} catch (error) {
  console.log("Error processing combined metadata:", error);
  return [{
    json: {
      validationStatus: 'error',
      validationMessage: `Processing failed: ${error.message}`,
      errorDetails: error.stack
    }
  }];
}
